import React, { Component } from "react";

import 'boxicons';

export class ProfileComponent extends Component {


/*


 _________  ______   ______   ______   __  __    
/________/\/_____/\ /_____/\ /_____/\ /_/\/_/\   
\__.::.__\/\::::_\/_\:::_ \ \\:::_ \ \\ \ \ \ \  
   \::\ \   \:\/___/\\:\ \ \ \\:\ \ \ \\:\_\ \ \ 
    \::\ \   \::___\/_\:\ \ \ \\:\ \ \ \\::::_\/ 
     \::\ \   \:\____/\\:\/.:| |\:\/.:| | \::\ \ 
      \__\/    \_____\/ \____/_/ \____/_/  \__\/ 
                                                 



*/
 
    
/* Hope theres no bugs */
    render() {
 
   
      return (
         
       
 
<div className='profile-container container'>
    <div className="profile-content">
<div className='profile-header'>
<div className="profile-img">{this.props.img==='' && <label>this.props.f+ this.props.l}</label>}</div>
<div className="profile-edit"> <button type="button" class="btn btn-secondary">Secondary</button></div>
</div>
    </div>
    </div>

     
      );
    }}
   
  
  export default ProfileComponent;
